import React, {Component} from "react"; // so react can translate all jsx into js

class Test extends Component{
     render(){
         return(
             <div className="category">
                 <div className="select">
                     <input type="radio" name="category" id="appetizer" value="appetizer"></input>
                     <label for="appetizer">Appetizer</label>
                     <input type="radio" name="category" id="entree" value="entree"></input>
                     <label for="entree">Entree</label>
                     <input type="radio" name="category" id="dessert" value="dessert"></input>
                     <label for="dessert">Dessert</label>
                 </div>
             </div>
         )
     }
}
